import React from 'react'
import {NavLink} from 'react-router-dom'
import s from './Header.module.css'

function Header() {
    let isActiv
    const onClickHandler = (sa: string) => {
        console.log(sa)
        isActiv = s.activ
    }
    return (
        <div className={s.wrapper}>
            <div className={s.navBox}>
                {/*// add NavLinks*/}
                <NavLink to={'/'} className={`${s.navLinck} ${isActiv}` } onClick={(event)=>onClickHandler('activ')}>pre-junior</NavLink>
                <NavLink to={'/zalupa'} className={(isActiv)=> isActiv ? `${s.navLinck} ${s.activ}` : s.navLinck } >junior</NavLink>
                <NavLink to={'/zalupa+'} className={`${s.navLinck} `} >junior+</NavLink>
                <div className={s.navLinckBtn}>x</div>
            </div>
        </div>
    )
}

export default Header
